import React,{Component} from 'react';
import { variables } from './Variables.js';

export class Listagem extends Component{

    constructor(props) {
      super(props);

      this.state = {
        Funcionarios:[]

      }
    }

  render(){
    return (
      <div>
        <table className='table table-striped'>
          <thead>
            <tr>
              <th>
                Matricula
              </th>
              <th>
                Nome
              </th>
              Setor
            </tr>
            <th>
              Ativo
              </th>
              <th>
                Foto
                </th>
          </thead>
          <tbody>
            {Funcionarios.map(funcio=>
              <tr key={funcio.Matricula}>
                <td>{funcio.Nome}</td>
                <td>{funcio.Setor}</td>
                <td>{funcio.Ativo}</td>
                <td></td>
              </tr>
              )}
          </tbody>
        </table>
      </div>


    )
  }

}
